DROP TABLE IF EXISTS coaches;
CREATE TABLE coaches(
   coachID     VARCHAR(10) NOT NULL 
  ,year        INTEGER  NOT NULL 
  ,tmID        VARCHAR(3) NOT NULL
  ,lgID        VARCHAR(4) NOT NULL
  ,stint       INTEGER  NOT NULL
  ,won         INTEGER 
  ,lost        INTEGER 
  ,post_wins   INTEGER 
  ,post_losses INTEGER 
  ,PRIMARY KEY(coachID, year, tmID)
);
